import React from "react";
import playStore from "./images/Appstore.png";
import appStore from "./images/playstore.png";
import "./App.css";

const Footer = () => {
  return (
    <footer id="footer">
      <div className="leftFooter">
        <div>
        <h4>DOWNLOAD OUR APP</h4>
        <p>Download App for Android and IOS mobile phone</p>
        </div>
        <div className="foot">
        <img src={playStore} alt="playstore" /> 
        <img src={appStore} alt="Appstore" />
         </div>

      </div>

      <div className="midFooter">
        <h3>A Square hydroponics</h3>
        <p>Vitawa,Thane, Maharashtra 400605, India</p>

        
      </div>

      <div className="rightFooter">
        <h4>Follow Us</h4>
        <a href="http://instagram.com/akshupdf">Instagram</a>
        <a href="http://youtube.com/berozgaarz">Youtube</a>
        <a href="http://facebook.com/akshupdf">Facebook</a>
      </div>
    </footer>
  );
};

export default Footer;
